<!DOCTYPE html>
<html>
	<head>
		<meta charset="utf-8">
		<title></title>
	</head>
	<body>
		<script type="text/javascript">
			function returnValue(e) {
				if (e.preventDefault) {
					e.preventDefault();
				} else if (e.returnValue) {
					e.returnValue();
				} else {
					return false;
				}
			}
		</script>
	</body>
</html>
